import React, { Component } from 'react';
import './head.css'
let data_1 = [
    {
        li_name: "ресив",
        ul_notis: "123",
        model:[11,22,33,44,55],
        layer_3:[]
    },
    {
        li_name: "каналы",
        ul_notis: "234",
        model:[11,22,33,44,55],
        layer_3:["rrrr"]
    },
    {
        li_name: "каналы",
        ul_notis: "456",
        model:[4,55],
        layer_3:[]
    },
    {
        li_name: "баги",
        ul_notis: "678",
        model:[11,22,33,44,55],
        layer_3:["ttttt","yyyyyyy"]
    },
    {
        li_name: "заказы",
        ul_notis: "890",
        model:[],
        layer_3:[]
    },
    {
        li_name: "IT",
        ul_notis: "wwww",
        model:[115],
        layer_3:[]
    },
]
const tt = data_1.map(el => <ul><li><a>{el.li_name}</a></li><li><a href="#">{el.ul_notis }</a></li><li>{el.model }</li><li>{el.layer_3 }</li></ul>)



const Head_ul = () => {
    return (
        <div>
            {tt}
        </div>
    )
}
export default Head_ul;










